css:
.editor-colors {
  background-color: #fcfcfd;
  color: #788d9e;
}
.editor .invisible-character {
  color: rgba(197, 200, 198, 0.2);
}
.editor .indent-guide {
  color: rgba(255, 255, 255, 0.15);
}
.editor .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
.editor .gutter {
  color: #c2ccd3;
  background-color: #fcfcfd;
}
.editor .gutter .cursor-line {
  color: #788d9e;
}
.editor .line-number.cursor-line-no-selection {
  background-color: none;
}
.editor .invisible {
  color: #788d9e;
}
.editor .cursor {
  border-color: #9191b6;
}
.editor .selection .region {
  background-color: #ededf3;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #888888;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.editor .comment {
  color: #d1d8de;
}
.editor .string {
  color: #a4bdd1;
}
.editor .constant.numeric {
  color: #5bc1f0;
}
.editor .constant.language {
  color: #5bc1f0;
}
.editor .constant.character,
.editor .constant.other {
  color: #5bc1f0;
}
.editor .keyword {
  color: #788d9e;
}
.editor .storage {
  color: #5bc1f0;
}
.editor .storage.type {
  font-style: italic;
  color: #5bc1f0;
}
.editor .entity.name.class {
  text-decoration: underline;
  color: #9ae26a;
}
.editor .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #9ae26a;
}
.editor .entity.name.function {
  color: #9ae26a;
}
.editor .entity.name.instance {
  color: #ff9740;
}
.editor .variable.parameter {
  font-style: italic;
  color: #FD971F;
}
.editor .entity.name.tag {
  color: #5bc1f0;
}
.editor .entity.other.attribute-name {
  color: #9ae26a;
}
.editor .support.function {
  color: #ff9740;
}
.editor .support.constant {
  color: #a4bdd1;
}
.editor .support.type,
.editor .support.class {
  font-style: italic;
  color: #ff9740;
}
.editor .invalid {
  color: #F8F8F0;
  background-color: #ff9740;
}
.editor .invalid.deprecated {
  color: #F8F8F0;
  background-color: #5bc1f0;
}
.editor .class.jade {
  color: #5bc1f0;
}
.editor .gfm .markup.heading {
  color: #6ed300;
  font-weight: bold;
}
.editor .gfm .markup.underline {
  color: #6ed300;
  text-decoration: underline;
}
.editor .gfm .bold {
  font-weight: bold;
}
.editor .gfm .italic {
  font-style: italic;
}
.editor .gfm .raw {
  color: #ff9740;
}
.editor .gfm .variable.list {
  color: #ff9740;
  font-weight: bold;
}
.editor .gfm .link {
  color: #CCC;
}
.editor .gfm .link .entity {
  color: #5bc1f0;
}
.with-minimap .vertical-scrollbar {
  opacity: 0;
  width: 0;
}
.minimap {
  left: 93%;
  width: 7%;
}
.pane ul.tab-bar li.tab .title:before {
  display: none;
}
.editor[data-grammar~="php"] .keyword.namespace,
.editor[data-grammar~="php"] .keyword.use,
.editor[data-grammar~="php"] .keyword.use-as,
.editor[data-grammar~="php"] .keyword.new {
  color: #5bc1f0;
}
.editor[data-grammar~="php"] .keyword.operator.string {
  color: #ff9740;
}
.editor[data-grammar~="php"] .keyword.control {
  color: #a4bdd1;
}
.editor[data-grammar~="php"] .constant:not(.language) {
  color: #788d9e;
}
.editor[data-grammar~="php"] .constant.numeric {
  color: #a4bdd1;
}
.editor[data-grammar~="php"] .variable.global {
  color: #5bc1f0;
}
.editor[data-grammar~="php"] .support.function,
.editor[data-grammar~="php"] .meta.function-call {
  color: #6799c2;
  /* color: lighten(@syntax-color-purple, 12%); */
}
